import React from "react";
import { withRouter, Link } from 'react-router-dom';
//import { Nav } from 'react-bootstrap'

import "../navigation/navigation.css";

class CommunicatorNavigation extends React.Component {
  render() {
    return (
      <div id="navigation" className="navbar navbar-inverse menu-background sht-navbar">
        <div class="navbar-header">
          <button type="button" class="navbar-toggle pull-left" data-toggle="collapse" data-target="#myNavbar" title="Menu">
              <i class="fa fa-bars fa-lg fa-menu-white" aria-hidden="true"></i>
          </button>
        </div>
        <div class="collapse navbar-collapse" id="myNavbar">
          <ul class="nav navbar-nav">
            <li class="hidden-lg showBtnLg">
              <Link to="/default" title="Home">
                <i class="fa fa-user fa-lg fa-menu-white" aria-hidden="true">
                  <img src={require("../../images/home.gif")} alt="Home" />
                </i>
              </Link>
            </li>
            
          </ul>
        </div>
      </div>
    )
  }
} 

export default withRouter(CommunicatorNavigation);
